import React from "react";
import { useDispatch, useSelector } from "react-redux";
import { authActions } from "../../../store/auth";
import { modalActions } from "../../../store/modals";
import Modal from "../../Layout/Modal";

import classes from "./LogoutModal.module.css";

const LogoutModal = () => {
  // const showLogout = useSelector((state) => state.modals.showLogoutModal);
  const dispatch = useDispatch();
  const logoutHandler = () => {
    dispatch(modalActions.closeModal());
    dispatch(authActions.logOut());
  };

  return (
    <Modal>
      <div className={classes.container}>
        <span className={classes.title}>Do you want to log out?</span>
        <button onClick={logoutHandler} className={classes.logoutButton}>
          Log Out
        </button>
      </div>
    </Modal>
  );
};

export default LogoutModal;
